import React, { useState } from 'react';
import { Container, Row, Col, Card, Form, Button, Tab, Tabs } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import axios from 'axios';
import './../App.css';

function Login({ onLogin }) {
  const navigate = useNavigate();
  const [loginData, setLoginData] = useState({ email: '', password: '' });
  const [registerData, setRegisterData] = useState({ 
    name: '', 
    email: '', 
    password: '', 
    confirmPassword: '' 
  });
  const [loading, setLoading] = useState(false);

  const handleLogin = async (e) => {
    e.preventDefault();
    
    // Demo login without API
    if (!loginData.email || !loginData.password) {
      toast.error('Please fill in all fields');
      return;
    }
    
    setLoading(true);
    
    try {
      // Mock login for demo
      setTimeout(() => {
        const mockUser = {
          token: 'demo-token-' + Date.now(),
          user: {
            id: 1,
            name: loginData.email.split('@')[0],
            email: loginData.email
          }
        };
        
        onLogin(mockUser.token);
        localStorage.setItem('user', JSON.stringify(mockUser.user));
        toast.success('Welcome to Drunk Donuts! üç©');
        navigate('/home');
      }, 1000);
      
    } catch (error) {
      toast.error('Login failed');
    } finally {
      setLoading(false);
    }
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    
    if (registerData.password !== registerData.confirmPassword) {
      toast.error('Passwords do not match');
      return;
    }
    
    if (registerData.password.length < 6) {
      toast.error('Password must be at least 6 characters');
      return;
    }
    
    setLoading(true);
    
    try {
      // Mock registration for demo
      setTimeout(() => {
        const mockUser = {
          token: 'demo-token-' + Date.now(),
          user: {
            id: Date.now(),
            name: registerData.name,
            email: registerData.email
          }
        };
        
        onLogin(mockUser.token);
        localStorage.setItem('user', JSON.stringify(mockUser.user));
        toast.success('Account created successfully! üéâ');
        navigate('/home');
      }, 1000);
      
    } catch (error) {
      toast.error('Registration failed');
    } finally {
      setLoading(false);
    }
  };

  const handleGoogleLogin = () => {
    toast.info('Google login coming soon!');
  };

  return (
    <div className="login-page">
      {/* Login Header with Logo */}
      <header className="login-header">
        <div className="login-header-logo">
          <div className="login-header-logo-image"></div>
          <h1 className="login-header-text">DRUNK DONUTS</h1>
        </div>
      </header>
      
      <Container className="login-container d-flex align-items-center justify-content-center">
        <Row className="w-100" style={{ maxWidth: '1000px' }}>
          <Col lg={6} className="d-none d-lg-flex align-items-center">
            {/* Branding Side with Logo */}
            <div className="login-branding text-center">
              <div className="login-branding-logo"></div>
              <h1 className="login-branding-title mb-3">
                DRUNK DONUTS
              </h1>
              <p className="login-branding-subtitle">
                Welcome to the sweetest experience!<br/>
                Sign in to explore our delicious collection.
              </p>
              <div className="features mt-5">
                <div className="feature-item mb-3">
                  <span className="feature-icon">üç©</span>
                  <span className="feature-text">Fresh donuts daily</span>
                </div>
                <div className="feature-item mb-3">
                  <span className="feature-icon">üéÇ</span>
                  <span className="feature-text">Premium fancies</span>
                </div>
                <div className="feature-item">
                  <span className="feature-icon">üöö</span>
                  <span className="feature-text">Fast delivery</span>
                </div>
              </div>
            </div>
          </Col>
          
          <Col lg={6}>
            <Card className="login-card shadow-lg border-0">
              <Card.Body className="p-5">
                <div className="text-center mb-4">
                  <h2 className="fw-bold login-form-title">Welcome!</h2>
                  <p className="login-form-subtitle">Sign in to your account</p>
                </div>
                
                <Tabs defaultActiveKey="login" className="mb-4 login-tabs">
                  <Tab eventKey="login" title="Login" className="login-tab">
                    <Form onSubmit={handleLogin}>
                      <Form.Group className="mb-3">
                        <Form.Label>Email address</Form.Label>
                        <Form.Control
                          type="email"
                          placeholder="Enter email"
                          value={loginData.email}
                          onChange={(e) => setLoginData({...loginData, email: e.target.value})}
                          required
                          className="form-control-premium"
                        />
                      </Form.Group>

                      <Form.Group className="mb-3">
                        <Form.Label>Password</Form.Label>
                        <Form.Control
                          type="password"
                          placeholder="Password"
                          value={loginData.password}
                          onChange={(e) => setLoginData({...loginData, password: e.target.value})}
                          required
                          className="form-control-premium"
                        />
                      </Form.Group>

                      <Button 
                        variant="primary" 
                        type="submit" 
                        className="w-100 mb-3 cta-btn"
                        disabled={loading}
                      >
                        {loading ? 'Logging in...' : 'Login'}
                      </Button>
                    </Form>
                  </Tab>
                  
                  <Tab eventKey="register" title="Register" className="register-tab">
                    <Form onSubmit={handleRegister}>
                      <Form.Group className="mb-3">
                        <Form.Label>Full Name</Form.Label>
                        <Form.Control
                          type="text"
                          placeholder="Enter your name"
                          value={registerData.name}
                          onChange={(e) => setRegisterData({...registerData, name: e.target.value})}
                          required
                          className="form-control-premium"
                        />
                      </Form.Group>

                      <Form.Group className="mb-3">
                        <Form.Label>Email address</Form.Label>
                        <Form.Control
                          type="email"
                          placeholder="Enter email"
                          value={registerData.email}
                          onChange={(e) => setRegisterData({...registerData, email: e.target.value})}
                          required
                          className="form-control-premium"
                        />
                      </Form.Group>

                      <Form.Group className="mb-3">
                        <Form.Label>Password</Form.Label>
                        <Form.Control
                          type="password"
                          placeholder="Password (min 6 characters)"
                          value={registerData.password}
                          onChange={(e) => setRegisterData({...registerData, password: e.target.value})}
                          required
                          minLength={6}
                          className="form-control-premium"
                        />
                      </Form.Group>

                      <Form.Group className="mb-3">
                        <Form.Label>Confirm Password</Form.Label>
                        <Form.Control
                          type="password"
                          placeholder="Confirm password"
                          value={registerData.confirmPassword}
                          onChange={(e) => setRegisterData({...registerData, confirmPassword: e.target.value})}
                          required
                          className="form-control-premium"
                        />
                      </Form.Group>

                      <Button 
                        variant="success" 
                        type="submit" 
                        className="w-100 cta-btn"
                        disabled={loading}
                      >
                        {loading ? 'Creating account...' : 'Register'}
                      </Button>
                    </Form>
                  </Tab>
                </Tabs>
                
                <div className="text-center">
                  <p className="login-social-text mb-3">Or continue with</p>
                  <Button 
                    variant="outline-danger" 
                    className="w-100 mb-3 google-btn"
                    onClick={handleGoogleLogin}
                  >
                    <i className="fab fa-google me-2"></i>
                    Google
                  </Button>
                  
                  <div className="login-terms mt-4">
                    <small className="text-muted">
                      By signing in, you agree to our Terms & Conditions
                    </small>
                  </div>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Login;
